import React from 'react';
import { Link } from 'react-router-dom';
import CategoryList from '../components/CategoryList';

const CategoriesPage = () => {
  return (
    <div>
      <h1>Фильмдерге өту</h1>
      <Link to="/movies" className="btn btn-primary mb-2">Add Movies</Link>
      <h1>Жаңа фильмдер қосу</h1>
      <Link to="/movies/new" className="btn btn-primary mb-2">New Movies</Link>
      <div>
        <label htmlFor="category">Category:</label>
        <select id="category">
          <option value="">All categories</option>
          {/* Add options for categories here */}
        </select>
      </div>
      <CategoryList />
    </div>
  );
};

export default CategoriesPage;
